import React, { Component } from "react";
import Wrapper from "../Wrapper";
import Button from "@material-ui/core/Button";
import axios from "axios";
import ReactToPrint from "react-to-print";
import ComponentToBePrinted from "./componentToBePrinted";

class PrintedForm extends Component {
  constructor(props) {
    super(props);
    this.state = {
      ticket: {},
      printView:false
    };
    console.log(this.props);
    this.ticketRef = React.createRef();

  }
  componentDidMount() {
    if (this.props.history.location.state != null) {
        let query = this.props.history.location.state.ticket;
        axios
          .get("/ticket/ticket", {
            params: {
              id: query,
            },
          })
          .then((response) => {
            console.log(response.data);
            this.setState({ ticket: response.data });
            console.log(this.state)
          })
          .catch((error) => {
            console.log(error);
          });
      }
  }

  render() {
    const { ticket,printView } = this.state;
    var Barcode = require("react-barcode");
    return (
      <div>
          {printView == false ?  <Wrapper>
        <div style={{ display: "inline-flex" }}>
